import { IonicModule } from '@ionic/angular';
import { Component } from "@angular/core";
import { HomeComponent } from './home/home.component';
import { FormsModule } from '@angular/forms';
import { BookComponent } from './book/book.component';
import { GpsComponent } from './gps/gps.component';
import { AccountComponent } from './account/account.component';
import { RouterOutlet } from '@angular/router';

@Component({
  selector: 'digitekisi-dashboard',
  standalone: true,
  templateUrl: './dashboard.component.html',
  imports: [IonicModule, HomeComponent, FormsModule, BookComponent, DashboardComponent, GpsComponent, AccountComponent, RouterOutlet]
})
export class DashboardComponent {
  selectedUser = 'As Passenger'
}
<div class="w-screen h-screen relative bg-white">

    <ion-router-outlet></ion-router-outlet>
  <ion-tabs>
    <ion-tab-bar slot="bottom" class="bg-gradient-primary">
      <ion-tab-button tab="home">
        <ion-icon name="home"></ion-icon>
      </ion-tab-button>
      <ion-tab-button tab="book">
        <ion-icon name="copy-outline"></ion-icon>
      </ion-tab-button>
      <ion-tab-button tab="gps">
        <ion-icon name="locate-outline"></ion-icon>
      </ion-tab-button>
      <ion-tab-button tab="account">
        <ion-icon name="person-circle-outline"></ion-icon>
      </ion-tab-button>
    </ion-tab-bar>
  </ion-tabs>
</div>
